 oson.","Bu to'plam maktab o'quvchilari uchun elektron darsliklar majmuasi. Ular matematika, ona tili, ingliz tili va boshqa fanlardagi ma'lumotlarni osonlik bilan o'rgatishga yordam beradi. Hozir o'rganishga qiziqmoqchi bo'lgan barcha darsliklar mavjud.","Bu to'plam ovqatlanish va pishirish uchun kerak bo'lgan barcha texnika va qo'shimcha mahsulotlar majmuasi. Uni ichiga elektrli pishirgichlar, qaynatgichlar, mikrovolnovka va boshqa asboblar bor.","Bu to'plam sportga qiziqishli insonlar uchun mo'ljallangan. Uni ichiga sport qilish, masofaviy tashqarida faol bo'lish va ko'p vaqt o'tkazish uchun zarur asboblar kiritilgan. Barchasi yuqori sifat va ishonchli.","Bu tuzilma ovqatlanish uchun idealdir. Ushbu tuzilma sifatli materiallardan ishlab chiqarilgan va hajmi kichik bo'lgan. Uni xonadon yoki do'konlarda qulaylik bilan joylashtirish mumkin.","Ushbu mashina eng yaxshi sifat va natijalar bilan to'qimachilik ishlarini bajaradi. Ishlab chiqarish materiallari yuqori sifat va sifatli. Uning katta yuklash qobiliyati va innovatsion funktsiyalari bor.","Ushbu smart soqol sizga yanada oson va qulayligini ta'minlash uchun mo'ljallangan. Uni ichiga bir necha funksiyalar mavjud, shuningdek qadam to'lash, qadam soni, oyoqning harakati va uyqu holati. Ushbu asbobning qulay dizayni va yuqori sifati bor.","Ushbu telefon yuqori sifatli ekran va quvvatli batareyaga ega. Ishlab chiqarish materiallari bo'yicha yuqori sifat va qattiqlikka ega. Kameralarining sifati yaxshi bo'lib, surat va video jalb qilishda ajoyib natijalarni taqdim etadi.","Ushbu tizim kichik bizneslar uchun xarajat va daromadlar hisobotlashda yordam beradi. Uni qo'llash oson va uni ishlatish oson. Bu tizim biznesning moliyaviy holatini yaxshilaydi va ma'lumotlarni to'plab yig'ishga yordam beradi.","Ushbu tizim taomlarni qayta ishlab chiqarish uchun mo'ljallangan va eng yaxshi sifat va natijalar bilan taomlarni qayta ishlab chiqaradi. Uni qo'llash oson va uni tozalash ham oson.","Ushbu to'plam dizayn va dekoratsiyalar bo'yicha kerak bo'lgan barcha materiallarni o'z ichiga oladi. Uni ichiga rangli ranglar, qadamlar, panel va boshqa materiallar bor.","Ushbu to'plam kichik korxonalar uchun mo'ljallangan va ularning dastlabki yutuqlarini bajarish uchun kerak bo'lgan asboblar bilan to'la. Uning ichida kompyuterlar, printerlar, telefaks mashinalari va boshqa asboblar mavjud.","Ushbu to'plam o'zingizning ishingizni asanlashtirish uchun mo'ljallangan. Uni ichiga yengil masxarabozlar va qo'shimcha qo'llanmalar mavjud. Ushbu qo'llanmalar o'zingizning ishingizni qulaylashtiradi va osonlashtiradi.","Ushbu to'plam ovqatlanish uchun muhim mahsulotlar majmuasi. Uni ichiga ovqatlanishni yaxshi tuzish uchun kerak bo'lgan barcha narsalar kiritilgan. Uni oson yig'ish va saqlash mumkin.","Ushbu to'plam yengil va sog'lom hayotni ta'minlash uchun mo'ljallangan. Uni ichiga muzlatilgan ichimliklar bor, shu bilan birga vitaminlar va naytrientlar ham. Bu ichimliklar sizni energiya bilan to'ldiradi va sog'lomlikni ta'minlaydi.","Ushbu to'plam yoshlar va bolalar uchun ta'lim va rivojlanishga mo'ljallangan o'yinlar majmuasi. Uni ichiga ta'limli o'yinlar, so'rovnoma va boshqa rivojlanish o'yinlari mavjud. Bu o'yinlar yoshlar va bolalar uchun foydali va o'zgaruvchan bo'lib xizmat qiladi.","Ushbu to'qima ustasi o'zgartirilgan dizayni va qulayliklari bilan ajralmas ma'muriyati bilan narsani ishlab chiqarishda yordam beradi. Uni oson qo'llash mumkin va uni joylashtirish oson.","Yuqori darajadagi grafika va kuchli protsessori bilan, bu noutbuk yuqori sifatli o'yinlar va kuchli dasturlar uchun idealdir. Uni qulaylik bilan o'zida yuritish va yuklash oson. Katta xotirasi va qulay klaviaturasiga ega."],W2={adjective:["Ajoyib","Amaliy","Arzon","Elegant","Elektron","Ergonomik","Fantastik","Hayratlanarli","Juda chiroyli","Katta","Kichik","Litsenziyalangan","Lyuks","Mayin","Qattiq","Qayta ishlangan","Qimmat","Qishloq xo'jaligi","Qo'l bilan ishlangan","Raqamli","Sharqona","Shaxsiy","Shirin","Tiklangan","Umumiy","Yengil","Y ,"Jouets","Livres","Maison","Musique","Ordinateurs","Outils","Plein air","Santé","Sports","Vêtements","Épicerie"],JN=["Bicyclette à 1 vitesse, pneus 1/2 ballon. Cadre de 52cm. Jantes chromées. Roue Hore.  Moyeux indéréglables. 2 freins sur jantes. Guidon trials. Garde-boue et couvre chaine en acier émaillé. Porte-bagages. Gardejupes. Pédales à blocs caoutchouc. Émail couleur. Selle route cuir. Sacoche avec outillage. Pompe de cadre. Timbre avertisseur.","Cadre raccord brasé de 53 ou 58 %. Jantes en acier émaillées. Pneus “Hiron” 700 x 35, garantis 12 mois. Pignon roue libre à emboitement hexagonal. Frein “Hirondelle” sur jante arrière. Garde-boue métal.","Carrosserie en tôle d'acier laqué blanc montée sur roues pour faciliter le déplacement, couvercle laqué blanc, dessus et cuve en métal émaille marron, inaltérable a l'eau de lessive et a la chaleur,","Ce magnifique radio-phono comprend un excellent récepteur radioL'ensemble, dans une belle ébénisterie teintée palissandre, forme un très phonique 6 lampes et un tourne-disque de vitesses placé sous le couvercle. Beau meuble. Ce modèle, dont le montage particulièrement soigne assure un très bon rendement aussi bien en radio qu'en phono, est garanti mn an.","Ces médailles et épingles sont en argent avec patine artistique. Elles ont été composées et frappées spécialement dans les ateliers de l'État pour la Société l'Hirondelle.","Lanterne cuivre fort, finement nickelé, chute d'eau réglable, suspension antivibratrice, projecteur diamètre cm2, avec verre bombé. Durée d'éclairage 3 heures. Poids 395 grammes.","Lunettes étanches, monture caoutchouc moulé de 1re qual. glaces rondes de 55 mm de diam. en verre clair. Les lunettes protègent les yeux contre les poussières, fumées et gaz industriels et se portent av. nos masques 5862-5864. Pds 60 gr.","Maillot en coton fin à rayures se boutonnant devant pour enfants.","Montre-bracelet, dite “d'Aviateur”, métal inaltérable, diam. 435ym. Mouvement de précision chronographe, cadran avec grande aiguille trotteuse, permettant la lecture 1/25de seconde.","Moteur Villiers. Puissance au frein : 7 HP, 3 vitesses, lancement au pied, éclairage électrique, carrosserie 2 places, coffre à outils, outillage complet, capote et pare-brise.","Petite griffe à sarcler. 5 dents en acier, largeur 8 cm. poignée estampée, longueur 26 cm. poids 150 gr. Pour ameublir le sol, arracher les herbes entre les plantes ou fleurs cultivées en lignes rapprochées.","Rasoir de sûreté “Prima” tout en laiton massif nickelé chromé, manche moleté bien en main. Peigne et contre-peigne galbés tenant tout d'une pièce, fermeture à charnière, blocage instantané de la lame.","Récepteurs de télévision à haute définition 819 lignes, donnant une image très nette et d'un contraste agréable ne fatiguant pas la vue, le montage de la partie radio donne un son absolument remarquable.","Tous nos appareils sont blindés pour que leur rayonnement ne trouble pas les récepteurs radiophoniques, et ils fonctionnent sur courant alternatif 50 riodes 110 et 220 volts. Ils sont garantis pendant 1 an; toutefois, suivant la règle, le tube cathodique est garanti pour 6 mois seulement."],IN={adjective:["Artisanal","Ergonomique","Fait main","Fantastique","Génial","Générique","Incroyable","Intelligent","Licencié","Luxueux","Magnifique","Moderne","Oriental","Petit","Pratique","Raffiné","Recyclé","Rustique","Sans marque","Savoureux","Sur mesure","Électronique","Élégant"],material:["Acier","Bois","Bronze","Béton","Caoutchouc","Congelé","Coton","Doux","Frais","Granit","Métal","Plastique"],product:["Boule","Chaise","Chapeau","Chaussures","Chemise","Clavier","Frites","Fromage","Gants","Lard","Ordinateur","Pantalon","Pizza","Poisson","Poulet","Salade","Saucisses","Savon","Serviettes","Souris","Table","Thon","Voiture","Vélo"]},ON={department:VN,product_description:JN,product_name:IN},$N=ON,WN=["EI","EURL","GIE","SA","SARL","SAS","SASU","SCA","SCOP","SCS","SEM","SNC"],ZN=["{{person.last_name.generic}} et {{person.last_nam
